import "../styles/MenuBar.css";
import userPic from '../assets/myPic.jpg';

const MenuBar = () => {
  return (
    <div className="menu-container">
      <header>
        <img src={userPic} alt="userImg"/>
        <div className="menu-bar">
          <a>ABOUT</a>
          <a>EXPERIENCE</a>
          <a>EDUCATION</a>
          <a>SKILLS</a>
        </div>
      </header>
    </div>
  );
};

export default MenuBar;
